import React from 'react'

const SpecialComponent = ({special}) => {
  return (
    <div>
         {special.map(special =>{
            <div>
          <h2>{special.title}</h2>
          <p>{special.description}</p>
          </div>
        })}
        
    </div>
  )
}

export default SpecialComponent
